function lenOfVDiagonal(grid: number[][]): number {
    const directions: number[][] = [[-1, -1], [-1, 1], [1, -1], [1, 1]];
    const availdableTurn: number[] = [1, 3, 0, 2];
    const values: {[key: number]: number} = {
        0: 2,
        2: 0
    };

    // const memo: number[][][][] = [];
    // for (let i : number = 0; i < grid.length; ++i) {
    //     memo.push([]);

    //     for (let j: number = 0; j < grid[0].length; ++j) {
    //         memo[i].push([]);

    //         for (let k: number = 0; k < directions.length; ++k) {
    //             memo[i][j].push([-1, -1]);
    //         }
    //     }
    // }

    // js use 1 dimensional array as 1 memory block
    const memo: number[] = new Array(grid.length * grid[0].length * 8).fill(-1);

    const dfs = (row: number, col: number, direction: number, turn: number): number => {
        // previous rows positions + current row positions + current position
        const key: number = row * grid[0].length * 8 + col * 8 + direction * 2 + turn;
        if (memo[key] !== -1) return memo[key];

        // if (memo[row][col][direction][turn] !== -1) {
        //     return memo[row][col][direction][turn];
        // }

        const val: number = grid[row][col];

        const availableDir: number[] = [direction];
        if (turn === 0) {
            availableDir.push(availdableTurn[direction]);
        }

        let res: number = 1;

        for (const d of availableDir) {
            const newRow = row + directions[d][0];
            const newCol = col + directions[d][1];

            if (newRow < 0 || newRow === grid.length || newCol < 0 || newCol === grid[0].length) {
                continue;
            }

            if (grid[newRow][newCol] !== values[val]) {
                continue;
            }

            const t: number = (direction === d) ? turn : turn + 1;
            let r: number = dfs(newRow, newCol, d, t);

            res = Math.max(res, r + 1);
        }

        // memo[row][col][direction][turn] = res;

        memo[key] = res;

        return res;
    };

    let res: number = 0;

    for (let row: number = 0; row < grid.length; ++row) {
        for (let col: number = 0; col < grid[0].length; ++col) {
            if (grid[row][col] !== 1) continue;

            res = Math.max(res, 1);

            for (let d: number = 0; d < directions.length; ++d) {
                const newRow = row + directions[d][0];
                const newCol = col + directions[d][1];

                if (newRow < 0 || newRow === grid.length || newCol < 0 || newCol === grid[0].length) {
                    continue;
                }

                if (grid[newRow][newCol] !== 2) {
                    continue;
                }

                const r: number = dfs(newRow, newCol, d, 0);

                res = Math.max(res, r + 1);
            }


        }
    }


    return res;
};



